import React from "react";
import { Box, Card, Typography } from "@mui/material";

function Playlist() {
    return (
        <Box m={2}>
            <Card variant="outlined">
                <Typography variant="h4" component="h1" sx={{ p: 2 }}>
                    Playlist goes here.            
                </Typography>
            </Card>  
        </Box>  
    );
}

export default Playlist;
